import './index.css';

import App from './App';
import {BrowserRouter} from 'react-router-dom'
import CoinProvider from './coinProvider/coinProvider.js'
import React from 'react';
import ReactDOM from 'react-dom';
import ScrollToTop from "./scrollToTop";

ReactDOM.render(
  <React.StrictMode>
    <CoinProvider>
      <BrowserRouter>
      <ScrollToTop />
        <App />
      </BrowserRouter>
    </CoinProvider>
  </React.StrictMode>,
  document.getElementById('root')
);

